import React from 'react';
const StopButton = (onClick) => {

    const stopStyles = {
        height: "60px",
        width: "60px",
        backgroundColor: "#555",
        backgroundColor: "#f5bc42",
        margin: "50px"
    }


    return (
        <div style={stopStyles}></div>
    );
}

export default StopButton
